import { Injectable } from '@angular/core';
import { Subject } from 'rxjs';
import { Router } from '@angular/router';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  /**
   * @description: 
   */
  private config = {
    signin : {
      eventAfterSignin: () => {
        this.router.navigate(['/profile']);
      },
    }
  };

  constructor() { }
}
